function MatchesCont() {
    return (
        <div className="p-4 rounded-lg flex justify-between items-center hover:bg-[#f8f8f8]">
            <div className="flex gap-3 items-center basis-6/12">

            </div>
            <div>
                <span className="bg-green-100 text-green-800 text-xs font-medium px-2.5 py-0.5 rounded border border-green-400">Finished</span>
            </div>
            <div className="text-end font-medium text-sm">
                October 18, 2023
            </div>
        </div>
    );
}

export default MatchesCont;
